#!/usr/bin/env python3
import sys
from typing import Text


def solve(N: int, S: "List[str]", T: "List[int]"):
    l = []
    for z in zip(T, S):
        l.append(z)
    l.sort(reverse=True)
    print(l[1][1])
    return


# Generated by 2.3.0 https://github.com/kyuridenamida/atcoder-tools  (tips: You use the default template now. You can remove this line by using your custom template)
def main():
    def iterate_tokens():
        for line in sys.stdin:
            for word in line.split():
                yield word
    tokens = iterate_tokens()
    N = int(next(tokens))  # type: int
    S = [str()] * (N)  # type: "List[str]"
    T = [int()] * (N)  # type: "List[int]"
    for i in range(N):
        S[i] = next(tokens)
        T[i] = int(next(tokens))
    solve(N, S, T)

if __name__ == '__main__':
    main()
